#!/usr/bin/env python3
import os
import json
import base64
import hashlib
import requests
from Crypto.Cipher import AES, PKCS1_OAEP
from Crypto.Util.Padding import unpad
from Crypto.PublicKey import RSA
from datetime import datetime

# === URLs Statiques ===
METADATA_URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/main/IPToP_1.4_encrypted.metadata.json"
HASH_URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/main/IPToP_1.4_encrypted.sha256"
SCRIPT_URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/main/IPToP_1.4_encrypted_ready_to_use.py"
LOCAL_BASE_NAME = "IPToP_1.4"

# === Fonctions de d√©chiffrement ===
def decrypt_data(encrypted_data, key):
    try:
        encrypted_data = base64.b64decode(encrypted_data)
        iv, ct = encrypted_data[:16], encrypted_data[16:]
        cipher = AES.new(key, AES.MODE_CBC, iv)
        return unpad(cipher.decrypt(ct), AES.block_size).decode()
    except Exception as e:
        print(f"‚ùå Erreur de d√©chiffrement: {e}")
        return None

def decrypt_key_with_rsa(encrypted_key, private_key):
    return PKCS1_OAEP.new(private_key).decrypt(base64.b64decode(encrypted_key))

# === Mise √† jour ===
def check_for_updates():
    try:
        print("üîç V√©rification des mises √† jour...")
        response = requests.get(METADATA_URL, timeout=10)
        
        if response.status_code == 200:
            remote_meta = response.json()
            with open(f"{LOCAL_BASE_NAME}_encrypted.metadata.json") as f:
                local_meta = json.load(f)
            
            if remote_meta["version"] > local_meta["version"]:
                print(f"üîÑ Version {remote_meta['version']} disponible")
                return True
            print("‚úÖ Vous avez la derni√®re version")
        else:
            print(f"‚ùå Impossible de v√©rifier (HTTP {response.status_code})")
            print(f"URL utilis√©e: {METADATA_URL}")
    except Exception as e:
        print(f"‚ö†Ô∏è Erreur: {str(e)}")
    return False

def perform_update():
    try:
        update_files = [
            (METADATA_URL, f"{LOCAL_BASE_NAME}_encrypted.metadata.json"),
            (HASH_URL, f"{LOCAL_BASE_NAME}_encrypted.sha256"),
            (SCRIPT_URL, f"{LOCAL_BASE_NAME}_encrypted_ready_to_use.py")
        ]
        
        for url, local_path in update_files:
            print(f"‚è¨ T√©l√©chargement {local_path}...")
            response = requests.get(url, timeout=10)
            
            if response.status_code == 200:
                with open(local_path, 'wb') as f:
                    f.write(response.content)
                print(f"‚úÖ Succ√®s")
            else:
                print(f"‚ùå √âchec (HTTP {response.status_code})")
                print(f"URL: {url}")
                return False
        return True
    except Exception as e:
        print(f"‚ùå Erreur critique: {str(e)}")
        return False

# === Point d'entr√©e ===
if __name__ == "__main__":
    if check_for_updates():
        if perform_update():
            print("üéâ Mise √† jour termin√©e - Relancez le script")
            exit()
    
    try:
        with open(f"{LOCAL_BASE_NAME}_encrypted.metadata.json") as f:
            metadata = json.load(f)
        
        if datetime.now() > datetime.strptime(metadata["expiration_date"], "%Y-%m-%d"):
            print("‚åõ Script expir√©")
            exit()
        
        with open("private_key.pem") as f:
            private_key = RSA.import_key(f.read())
        
        decrypted_script = decrypt_data(
            """""",
            decrypt_key_with_rsa(metadata["encrypted_key"], private_key)
        )
        
        if decrypted_script:
            exec(decrypted_script)
    except Exception as e:
        print(f"‚ùå Erreur critique: {str(e)}")
